        return (
            <>
                <li className='BannerBot'>
                    <ul>
                        <button onClick={() => {console.log("hello")}}></button>
                    </ul>
                    <ul>
                        <button onClick={() => {console.log("hello")}}></button>
                    </ul>
                    <ul>
                        <button onClick={() => {console.log("hello")}}></button>
                    </ul>
                    <ul>
                        <button onClick={() => {console.log("hello")}}></button>
                    </ul>
                </li>
            </>
        )
    }
}

class Banner extends React.Component {
    render() {
        return (
            <>
                <div className='BannerTop'>
                    <FontAwesomeIcon icon="fa-thin fa-user-robot" style={{color: "rgb(0, 0, 0)"}}/>
                    <p className="name">Hello World</p>
                </div>
                <Pages/>
            </>
        )
    }
}

export {Banner}
